Hi there, I’m Cory, welcome to my website! I’m a Lead Data Scientist specializing in healthcare analytics, economics, and machine learning. I’m particularly interested in:

Supply chain optimization and economic modeling
Reinforcement learning applications in healthcare
Causal inference and econometrics
MLOps and production deployment

Below you’ll find my newest blog posts about these topics and more. I also do consulting work - click here to learn more.





